import { useAuth } from "./context/AuthContext";
import LoginPage from "./pages/LoginPage";
import ChatPage from "./pages/ChatPage";

const App = () => {
  const { username } = useAuth();
  return !username ? <LoginPage /> : <ChatPage />;
};

export default App;
